import React, { useState } from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import ''
const ThirdStep = () => {
  const [formData, setFormData] = useState({
    address: {
      street: '',
      apartment: '',
      city: '',
      state: '',
      zip: '',
      country: 'Sri Lanka',
      instructions: ''
    },
    contact: {
      phoneNumber: '',
      secondaryPhone: '',
      email: ''
    }
  });

  const [error, setError] = useState('');

  const handleChange = (e) => {
    const { name, value } = e.target;
    const [category, field] = name.split('.'); // Handle nested form inputs
    setFormData((prevData) => ({
      ...prevData,
      [category]: {
        ...prevData[category],
        [field]: value
      }
    }));
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    if (formData.address.country !== 'Sri Lanka') {
      setError('Please select "Sri Lanka" as the country.');
      return;
    }
    setError('');
    console.log('Form submitted successfully:', formData);
    // Perform further actions such as sending form data to a server
  };

  return (
    <div className="form-container">
      <h3>3. Delivery and Contact Information</h3>
      <form onSubmit={handleSubmit}>
        <div className="form-section">
          <h4>Delivery Address <span>*</span></h4>
          <input
            type="text"
            name="address.street"
            placeholder="Street Name"
            value={formData.address.street}
            onChange={handleChange}
            required
          />
          <input
            type="text"
            name="address.apartment"
            placeholder="Apartment, Suite, Etc"
            value={formData.address.apartment}
            onChange={handleChange}
          />
          <input
            type="text"
            name="address.city"
            placeholder="City"
            value={formData.address.city}
            onChange={handleChange}
            required
          />
          <input
            type="text"
            name="address.state"
            placeholder="State"
            value={formData.address.state}
            onChange={handleChange}
          />
          <input
            type="text"
            name="address.zip"
            placeholder="Postal / Zip Code"
            value={formData.address.zip}
            onChange={handleChange}
            required
          />
          <select
            name="address.country"
            value={formData.address.country}
            onChange={handleChange}
          >
            <option value="Sri Lanka">Sri Lanka</option>
            <option value="Other">Other</option>
          </select>
          <textarea
            name="address.instructions"
            placeholder="Delivery Instructions (optional)"
            maxLength={75}
            value={formData.address.instructions}
            onChange={handleChange}
          />
        </div>

        <div className="form-section">
          <h4>Contact Information <span>*</span></h4>
          <input
            type="text"
            name="contact.phoneNumber"
            placeholder="Phone Number"
            value={formData.contact.phoneNumber}
            onChange={handleChange}
            required
          />
          <input
            type="text"
            name="contact.secondaryPhone"
            placeholder="Secondary Phone Number"
            value={formData.contact.secondaryPhone}
            onChange={handleChange}
          />
          <input
            type="email"
            name="contact.email"
            placeholder="Email"
            value={formData.contact.email}
            onChange={handleChange}
            required
          />
        </div>

        {error && <p className="error-message">{error}</p>}

        <div className="form-buttons">
          <button type="button">Back</button>
          <button type="submit">Next Step</button>
        </div>
      </form>
    </div>
  );
};

export default ThirdStep;
